import pic1 from "../images/xd1.avif"
import pic2 from "../images/xd2.avif"

export default function Featured(num){

    const arr = [pic1, pic2]
    return(
        <div className="featured-container">
            <img src={arr[num['num']]} className="featured-image"/>
        </div>
    )

}
